import './App.css';
import Hero from './components/hero';
import AOS from "aos";
import "aos/dist/aos.css";

export default function App() {
  useEffect(() => {
    AOS.init();
    AOS.refresh();
  }, []);
  return (
   <div>
      <Hero onScroll={this.handleScroll}/>
   </div>
  )
};
